import React, { useState } from "react";

const AdminPage = () => {
    const [credentials, setCredentials] = useState({ username: "", password: "" });
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [error, setError] = useState("");
    const [submissions, setSubmissions] = useState([]);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setCredentials({ ...credentials, [name]: value });
    };

    const handleLogin = async (e) => {
        e.preventDefault();
        setError("");

        try {
            const response = await fetch("http://localhost:5000/api/admin-login", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(credentials),
            });

            if (!response.ok) throw new Error("Invalid credentials");

            setIsAuthenticated(true);

            // Fetch submissions
            const submissionsResponse = await fetch("http://localhost:5000/api/submissions", {
                headers: {
                    username: credentials.username,
                    password: credentials.password,
                },
            });

            const data = await submissionsResponse.json();
            setSubmissions(data);
        } catch (err) {
            setError(err.message);
        }
    };

    const handleLogout = () => {
        setIsAuthenticated(false);
        setCredentials({ username: "", password: "" });
        setSubmissions([]);
    };

    return (
        <div className="min-h-screen flex items-center justify-center bg-gray-100">
            {!isAuthenticated ? (
                <div className="w-full max-w-sm bg-white shadow-md rounded-lg p-6">
                    <h1 className="text-2xl font-semibold text-center text-gray-800 mb-6">
                        Admin Login
                    </h1>
                    <form onSubmit={handleLogin}>
                        <div className="mb-4">
                            <label
                                htmlFor="username"
                                className="block text-sm font-medium text-gray-700"
                            >
                                Username
                            </label>
                            <input
                                type="text"
                                id="username"
                                name="username"
                                value={credentials.username}
                                onChange={handleInputChange}
                                className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500"
                                required
                            />
                        </div>
                        <div className="mb-4">
                            <label
                                htmlFor="password"
                                className="block text-sm font-medium text-gray-700"
                            >
                                Password
                            </label>
                            <input
                                type="password"
                                id="password"
                                name="password"
                                value={credentials.password}
                                onChange={handleInputChange}
                                className="mt-1 block w-full px-3 py-2 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500"
                                required
                            />
                        </div>
                        {error && (
                            <p className="text-red-600 text-sm mb-4">{error}</p>
                        )}
                        <button
                            type="submit"
                            className="w-full bg-blue-600 text-white py-2 px-4 rounded-lg hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500"
                        >
                            Login
                        </button>
                    </form>
                </div>
            ) : (
                <div className="w-full max-w-4xl bg-white shadow-md rounded-lg p-6">
                    <div className="flex justify-between items-center mb-6">
                        <h1 className="text-2xl font-semibold text-gray-800">Admin Dashboard</h1>
                        <button
                            onClick={handleLogout}
                            className="bg-red-500 text-white px-4 py-2 rounded-lg hover:bg-red-600 focus:outline-none focus:ring-2 focus:ring-red-400"
                        >
                            Logout
                        </button>
                    </div>
                    <div className="overflow-x-auto">
                        <table className="min-w-full bg-white border border-gray-200 rounded-lg shadow-md">
                            <thead className="bg-gray-100">
                                <tr>
                                    <th className="py-2 px-4 border-b border-gray-200 text-left text-sm font-medium text-gray-600">
                                        Name
                                    </th>
                                    <th className="py-2 px-4 border-b border-gray-200 text-left text-sm font-medium text-gray-600">
                                        Mobile
                                    </th>
                                    <th className="py-2 px-4 border-b border-gray-200 text-left text-sm font-medium text-gray-600">
                                        Email
                                    </th>
                                    <th className="py-2 px-4 border-b border-gray-200 text-left text-sm font-medium text-gray-600">
                                        Service
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                                {submissions.map((submission, index) => (
                                    <tr
                                        key={index}
                                        className={
                                            index % 2 === 0
                                                ? "bg-white"
                                                : "bg-gray-50"
                                        }
                                    >
                                        <td className="py-2 px-4 border-b border-gray-200 text-sm text-gray-800">
                                            {submission.name}
                                        </td>
                                        <td className="py-2 px-4 border-b border-gray-200 text-sm text-gray-800">
                                            {submission.mobile}
                                        </td>
                                        <td className="py-2 px-4 border-b border-gray-200 text-sm text-gray-800">
                                            {submission.email || "N/A"}
                                        </td>
                                        <td className="py-2 px-4 border-b border-gray-200 text-sm text-gray-800">
                                            {submission.services}
                                        </td>
                                    </tr>
                                ))}
                                {submissions.length === 0 && (
                                    <tr>
                                        <td
                                            colSpan="4"
                                            className="py-4 px-4 text-center text-gray-500"
                                        >
                                            No submissions yet.
                                        </td>
                                    </tr>
                                )}
                            </tbody>
                        </table>
                    </div>
                </div>
            )}
        </div>
    );
};

export default AdminPage;
